<script>
import { gsap, TweenLite } from 'gsap';
const tl = gsap.timeline({ repeat: -1, repeatDelay: 1 });
export default {
	// layout: 'mainPage',
	components: {
		RadarInfo: () => import('../components/hotel/mainPage/RadarInfo.vue')
	},
	data() {
		return {
			w: 0,
			positionX: null,
			request: null
		};
	},
	mounted() {
		tl.to('#info2', { duration: 4, opacity: 1 })
			.to('#info5', { duration: 3, opacity: 0 })
			.to('#info1', { duration: 4, opacity: 0 })
			.to('#info3', { duration: 4, opacity: 1 })
			.to('#info7', { duration: 3, opacity: 0 })
			.to('#info4', { duration: 4, opacity: 1 })
			.to('#info1', { duration: 4, opacity: 1 })
			.to('#info2', { duration: 3, opacity: 0 })
			.to('#info5', { duration: 4, opacity: 1 })
			.to('#info3', { duration: 3, opacity: 0 })
			.to('#info8', { duration: 4, opacity: 0.3 })
			.to('#info1', { duration: 3, opacity: 0 })
			.to('#info7', { duration: 4, opacity: 1 })
			.to('#info1', { duration: 4, opacity: 1 })
			.to('#info4', { duration: 3, opacity: 0 });
	},
	methods: {
		parallax(e) {
			this.w = window.innerWidth / 2;
			/* let h = window.innerHeight/2; */
			this.positionX = (e.clientX - this.w) * 0.0035;

			cancelAnimationFrame(this.request);
			this.request = requestAnimationFrame(this.update);

			/* elFront.style.transform = `translateX(${-positionX}%)`;
         elBack.style.transform = `translateX(${positionX}%)`; */
		},
		update() {
			TweenLite.to('#back', 5, { x: -this.positionX + '%', ease: 'power2.out' });
			TweenLite.to('#front', 5, { x: this.positionX + '%', ease: 'power2.out' });
		}

	},
	middleware: 'cityRedirect',
	head() {
		return {
			meta: [
				{
					hid: 'description',
					name: 'description',
					content: 'موتور جستجوی هتل، اقامتگاه و پرواز رادار۳۶۱ چیست و چگونه اطلاعات، نتایج، نظرات و .. را از وبسایت های رزرواسیون مختلف جمع آوری و دسته بندی میکند؟'
				}
			],
			title: 'رادار چگونه کار میکند؟'
		};
	}
};
</script>
